const loginForm = (params) => {
    return (
        <div>
            <h2>Log-in to application</h2>
            <form>
                <label>username: </label><input type='text' name='Username' value={params.username} onChange={({target}) => params.setUsername(target.value)} /><div></div>
                <label>password: </label><input type="password" value={params.password} name="Password" onChange={({target}) => params.setPassword(target.value)} />
                <button type='submit'>login</button>
            </form>
        </div>
    )
}
export default loginForm
